(14, 'terms_condition', '<h1>Terms &amp; Conditions</h1>\r\n\r\n<p>Thank you for visiting this website Online Global Shop. Please read the terms and conditions before accessing this website. We operate this site for promoting and selling the products and services supplied by us. By using this site, you signify your acceptance of these conditions in return for which we will provide you with access. From time to time we may modify the conditions so please continue to review the conditions of use whenever accessing or using this site. If at any time you do not wish to accept these conditions then you may not use this site.</p>\r\n\r\n<p><strong>Electronic Communication</strong></p>\r\n\r\n<p>While using https://www.onlineglobalshop.com or sending emails to https://www.onlineglobalshop.com , you are communicating with https://www.onlineglobalshop.com through electronic medium. You consent to receive communications from https://www.onlineglobalshop.com through electronic medium. https://www.onlineglobalshop.com&nbsp;will communicate with you by the email or by posting notices on the website/store. You agree that all agreements, notices, disclosures and other communications that website/store. You agree that all agreements, notices, disclosures and other communications that we provide to you electronically gratify and legal requirement that such communications be in writing.</p>\r\n\r\n<p><strong>Accounts</strong></p>\r\n\r\n<p>When you create an account with us, you must provide us information that is accurate, complete, and current at all times. Failure to do so constitutes a breach of the Terms, which may result in immediate termination of your account on our Service.</p>\r\n\r\n<p>You are responsible for safeguarding the password that you use to access the Service and for any activities or actions under your password, whether your password is with our Service or a third-party service.</p>\r\n\r\n<p>You agree not to disclose your password to any third party. You must notify us immediately upon becoming aware of any breach of security or unauthorized use of your account.</p>\r\n\r\n<p>You may not use as a username the name of another person or entity or that is not lawfully available for use, a name or trade mark that is subject to any rights of another person or entity other than you without appropriate authorization, or a name that is otherwise offensive, vulgar or obscene.</p>\r\n\r\n<p><strong>Password and Security</strong></p>\r\n\r\n<p>When you register to use the website you will be asked to create a password. You must keep this password confidential and must not disclose to it or share with anyone. You will be responsible for all activities and orders that occur or are submitted under your password. If you know or suspect that someone else knows your password you should notify us by contacting us immediately. We would also suggest that you also change your password immediately through my account section of the website.</p>\r\n\r\n<p>If Online Global Shop team has reason to believe that there is likely to be a breach of security or misuse of the https://www.onlineglobalshop.com website, we may require you to change your password or we may suspend or cancel your account.</p>\r\n\r\n<p><strong>Payments</strong></p>\r\n\r\n<p>You must ensure that Online Global Shop are provided with accurate personal information, contact nos. and delivery address. You must update us with any change to these details within the deadlines specified on the website. As of now, Online Global Shop accepts cash on delivery.</p>\r\n\r\n<p><strong>Product Purchases</strong></p>\r\n\r\n<ol>\r\n	<li>You must be over the age of eighteen to purchase products from Online Global Shop (https://www.onlineglobalshop.com&nbsp;). If you have ordered any product from us and cannot be at home at your selected delivery time, it is your responsibility to ensure that a suitable person aged eighteen or older is there to receive the order.</li>\r\n	<li>You may submit orders for products by using our online ordering facility on the website at any time after you have created an account. The facility and our communications to you in relation to any order or contract will be in the English language. The facility allows you to review your order and make any corrections before submitting it to us and by submitting the order you confirm that you have made any such corrections.</li>\r\n	<li>Each product for which you click &lsquo;Add to cart&rsquo; is added to &lsquo;Cart&rsquo; facility. You are given the opportunity to review the quantity and frequency of order in your Dashboard when you choose to &lsquo;check out&rsquo;. You can change these, or cancel the purchase of each of the products completely, at this stage, at any time before clicking &lsquo;place order&rsquo;. After you have clicked &lsquo;place order&rsquo; and after our acceptance of your order, items are added to your delivery in addition to any items that you have previously ordered. You can view your order details by clicking on &lsquo;my dashboard&rsquo; whenever you are logged in.</li>\r\n	<li>Your submission of an order amounts to an offer to enter a contract to buy the products from us; subject to point 3, you cannot then withdraw or cancel your order except as stated below.</li>\r\n	<li>Order is accepted from you until our website displays an order confirmation message. This message is displayed after you click &lsquo;place order&rsquo; located at bottom of the page. When you order by telephone, your order will be accepted (or rejected, as the case may be) verbally by our staff. A contract for our sale of products to you arises on our acceptance of your order.</li>\r\n	<li>Where we accept an order, we do all that we can to ensure that your order is fulfilled. Products are, however, subject to availability and market conditions and we do not always know if a product is or will be available at the time of accepting an order. If we are unable to deliver an item you have ordered, we may offer a reasonable substitute. You may reject that substitute, and you will not be charged for it or if you have paid already, we will refund any amount paid for it. If we do not offer a substitute, we will remove the product from your order so that you are not charged or if you have paid already, we will refund you the price. We will, however, bear no liability for unavailability of products.</li>\r\n	<li>Subject to clauses 8 and 9 Below, the price that we charge you for the products will be the price stated by us on the website prior to you clicking the &lsquo;place order&rsquo; button.</li>\r\n	<li>All products offered by us are subject to seasonal changes in supply levels and market prices. If you are a &lsquo;subscription&rsquo; customer (e.g. where you choose to have repeat orders of products) the prices for certain products may therefore differ from the price for those products when first ordered by you. The prices for all products ordered on a subscription basis shall be those prices for the products stated on our website. We recommend that you check the website regularly. The website still allows you to review all the products (and their prices) that you have already ordered from us, and make amendments and corrections to them until the deadlines published on the website.</li>\r\n	<li>Some of our products are priced by weight (for example, Honey, and Mustard Oil). We show the prices for weights on the website. The guide weight is for guidance only; the weight you receive may vary from this guide and the price you are charged will be for the weight of product delivered.</li>\r\n	<li>Ordering a product from us carries with it the obligation to pay for it unless we receive from you a cancellation of or change to your orders before the deadlines published on the website. We are also happy to inform you of these deadlines by telephone if you wish to call us. You remain responsible for ensuring that any such change or cancellation is not only transmitted by you, but received by us, in time for the deadline. We reserve the right to deliver and charge in full for any order unless we have received notice of cancellation before the published deadline. This deadline is important since, typically, we make up the deliveries for dispatch to you the day before delivery and obtain some of the products especially to fulfill your order and may not be able to sell the products elsewhere. Any payments you have made for orders which have been properly cancelled will be return to you. Despite the foregoing, if you are a consumer, then you may also cancel the order in accordance with paragraph 9.3 below in so far as the order is for non-perishable products.</li>\r\n	<li>We sell only to end users and our products are not for re-sale. You warrant that you shall not re-sell any of the products.</li>\r\n	<li>All prices for products are inclusive of any applicable taxes.</li>\r\n</ol>\r\n\r\n<p><strong>Changes</strong></p>\r\n\r\n<p>We reserve the right, at our sole discretion, to modify or replace these Terms at any time. If a revision is material we will try to provide at least 30 days notice prior to any new terms taking effect. What constitutes a material change will be determined at our sole discretion.</p>\r\n\r\n<p>By continuing to access or use our Service after those revisions become effective, you agree to be bound by the revised terms. If you do not agree to the new terms, please stop using the Service.</p>\r\n\r\n<p><strong>Intellectual Property</strong></p>\r\n\r\n<p>The Service and its original content, features and functionality are and will remain the exclusive property of https://www.onlineglobalshop.com&nbsp; and its licensors. The Service is protected by copyright, trademark, and other laws of both the Bangladesh and foreign countries. Our trademarks and trade dress may not be used in connection with any product or service without the prior written consent of https://www.onlineglobalshop.com</p>\r\n\r\n<p><strong>Links to Other Web Sites</strong></p>\r\n\r\n<p>Our Service may contain links to third-party web sites or services that are not owned or controlled by https://www.onlineglobalshop.com</p>\r\n\r\n<p>https://www.onlineglobalshop.com&nbsp;has no control over, and assumes no responsibility for, the content, privacy policies, or practices of any third party web sites or services. You further acknowledge and agree that https://www.onlineglobalshop.com shall not be responsible or liable, directly or indirectly, for any damage or loss caused or alleged to be caused by or in connection with use of or reliance on any such content, goods or services available on or through any such web sites or services.</p>\r\n\r\n<p>We may update these Terms and Conditions from time to time by posting the updated Terms and conditions on our website in place of these. The changes will apply to the use of the onlineglobalshop.com website after we have given notice. If you do not wish to accept the new Terms and Conditions, you should not continue to order from Online Global Shop or use the https://www.onlineglobalshop.com website. If you continue to use the https://www.onlineglobalshop.com&nbsp;website after the date on which the change comes into effect, your use of the<br />\r\nOnline Global Shop (https://www.onlineglobalshop.com) website indicates your agreement to be bound by the new Terms and Conditions.</p>', NULL, '2023-03-25 09:48:08'),
(15, 'about_us', '<p>Online Global Shop is a revolutionary online marketplace that brings together buyers and sellers from all over Bangladesh on the same platform.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Online Global Shop allows for smooth online shopping in Bangladesh and abroad by giving the buyers the option to pay through the &lsquo;cash on delivery&rsquo; mode of payment as well as Advance Payment through Credit card or Debit card. Online Global Shop is Bangladesh&rsquo;s leading ecommerce online shopping mall.</p>\r\n\r\n<p>It also allows individual and professional sellers to display their products to potential buyers. Online Global Shop brings buyers the best deals on all goods ranging from personal to home to office of goods and services including Clothing, footwear, watches, electronics, mobiles, cameras, home appliances and much more.</p>\r\n\r\n<p>All prices on the website are fixed and non-negotiable. Free Home Delivery service is an additional motto for the customer satisfaction.</p>\r\n\r\n<p>Online Global Shop believes in providing its customers with an exceptional online shopping experience by allowing them to compare prices of different among seller and ensuring smooth transactions. Shop from Online Global Shop today for an inexpensive, affordable and fun online shopping experience reaches at your door steps.</p>', NULL, '2023-02-20 10:45:41'),
