(45, 'privacy_policy', '<h1>Privacy Policy</h1>\r\n\r\n<p><strong>The&nbsp;Online Global Shop&nbsp;(</strong>https://www.onlineglobalshop.com<strong>)</strong> recognizes that privacy is very important to our customers and we pledge to protect the security and privacy of any personal information customers provide to us.</p>\r\n\r\n<p>As part of our commitment to our customers,&nbsp;Online Global Shop has implemented the following comprehensive privacy policy.</p>\r\n\r\n<p><strong>SUMMARY</strong><br />\r\n<br />\r\nWe value the privacy of our website visitors. We will only collect and use your information as explained in this policy. This section gives a brief overview of our data collection and use policies. Please click on the links below for a more detailed discussion of each topic. Please contact us at&nbsp;contact@onlineglobalshop.com or at&nbsp;+880 9619-260101 if you have any questions.<br />\r\n<br />\r\n<strong>We collect the following information:</strong></p>\r\n\r\n<p>&bull; Information that your browser routinely shares with websites.</p>\r\n\r\n<p>&bull; Personal information that you provide us on a voluntary basis.</p>\r\n\r\n<p>&bull; If you use the mobile version of our website, it may use geographic information temporarily collected from your mobile device to find participating stores in your area.</p>\r\n\r\n<p><br />\r\n<strong>We use and disclose the information we collect for the following purposes:</strong></p>\r\n\r\n<p>&bull; To provide services or products that you request.</p>\r\n\r\n<p>&bull; To help us improve our website, understand our customers and their preferences, and to market our products and services.</p>\r\n\r\n<p>&bull; to our contractors who provide supporting services so that they can access information needed for such services, but only on terms consistent with this policy.</p>\r\n\r\n<p>&bull; to protect our business interests or the rights of others, when required by law, to cooperate with law enforcement, or in connection with the sale or merger of all or part of our business.</p>\r\n\r\n<p><br />\r\n<strong>We use these commercially reasonable data security practices:</strong></p>\r\n\r\n<p>&bull; We limit access to your personal information to those who have legitimate need to use it.</p>\r\n\r\n<p><br />\r\nOther details about our practices:</p>\r\n\r\n<p>&bull; Although we may have links to other websites, this policy applies only to the websites operated by Online Global Shop.</p>\r\n\r\n<p>&bull; We use your personal information only for the purposes for which it is collected and consistent with this policy, and we retain your information as permitted by applicable law.</p>\r\n\r\n<p>&bull; You can update your online account information at any time.</p>\r\n\r\n<p>&bull; We do not intend to collect information from children under the age of 18.</p>\r\n\r\n<p>&bull; We may update this policy from time to time, but we will allow you to opt in to any material changes in how we use your personal information.</p>\r\n\r\n<p><strong>How We Collect Information:</strong></p>\r\n\r\n<ul>\r\n	<li><strong>INFORMATION PROVIDED BY YOUR WEB BROWSER</strong></li>\r\n</ul>\r\n\r\n<p>This website provides information about our stores and the products we sell. You do not need to provide us with any personal information if you simply want to browse through our website and learn more about our online shop, our products and our services. Like many other websites, we may record information that your web browser routinely shares, such as your browser type, browser language, software and hardware attributes, the date and time of your visit, the website from which you came, the geographical location of the Internet Protocol address and the pages on this website that you visit. This will generally be anonymous data that we collect on an aggregate basis. We will not try to associate anonymous data with the personal information that you provide to us, except to investigate apparent fraud or a threat to our website, our business or our users.</p>\r\n\r\n<ul>\r\n	<li><strong>PERSONAL INFORMATION THAT YOU PROVIDE</strong></li>\r\n</ul>\r\n\r\n<p>We may also collect personal information that you choose to provide to us on a voluntary basis. When we ask for your personal information, it is so that we can provide a product or service to you and communicate with you about those products and services. For example, you can register on one of our stores&rsquo; websites by providing us with your name, address; telephone number and e-mail address, and then elect to receive newsletters or regularly scheduled e-mail. Among other things, you can elect to participate in contests that we may run from time to time, purchase special order grocery item or create a personal shopping list. It will always be your choice whether to provide your personal information in order to take advantage of these features.</p>\r\n\r\n<ul>\r\n	<li><strong>ADDITIONAL INFORMATION COLLECTED FROM MOBILE DEVICES</strong></li>\r\n</ul>\r\n\r\n<p>We may also operate a version of this website specifically designed to work with mobile devices. The mobile website may include a feature that uses geographic location information provided by your mobile device to identify stores in your vicinity. We do not collect or store your geographic information except to temporarily provide this service.</p>\r\n\r\n<p><strong>LEGAL DISCLAIMER</strong></p>\r\n\r\n<p>We reserve the right to disclose your personally identifiable information as required by law and when believe it is necessary to share information in order to investigate, prevent, or take action regarding illegal activities, suspected fraud, situations involving potential threats to the physical safety of any person, violations of terms of use for a website of ours, or as otherwise required by law.</p>\r\n\r\n<p><strong>COOKIES</strong></p>\r\n\r\n<p>&ldquo;Cookies&rdquo; are small pieces of information sent by a web server to a web browser, which enables the server to collect information from the browser. We use cookies for a number of purposes, for instance to enable us to simplify the logging on process for registered users, to help ensure the security and authenticity of registered users, to provide the mechanisms for online shopping and to enable traffic monitoring.</p>\r\n\r\n<p>We use both session ID cookies and persistent cookies. We use session ID cookies to make it easier for you to navigate our site. A session ID cookie expires when you close your browser. A persistent cookie remains on your hard drive for an extended period of time, unless you remove the cookie in the manner determined by your particular Internet browser. Disabling the cookie function for your Internet browser will restrict the online services you can use at one of our websites.</p>\r\n\r\n<p><strong>HOW WE PROTECT YOUR DATA</strong></p>\r\n\r\n<p>We work to protect the security of your information during transmission by using Secure Sockets Layer (SSL) software, which encrypts information you input. We reveal only the last four digits of your credit card numbers when confirming an order. Of course, we transmit the entire credit card number to the appropriate credit card company during order processing. It is important for you to protect against unauthorized access to your password and to your computer. Be sure to sign off when finished using a shared computer.</p>\r\n\r\n<p><strong>THIRD PARTY WEBSITES</strong></p>\r\n\r\n<p>This website may contain links to other websites operated by companies that are not affiliated with us. For example, grocery delivery may be made available through a third party service provider, and you would be linked to that party&rsquo;s website to fulfill your order. Also, you may have come to this website from a website that is not operated by us. We are not responsible for the operation of these other websites or the information that they collect from their visitors. If you would like to know how another website collects and uses your information, please review its privacy policy.</p>\r\n\r\n<p><strong>CHANGES TO YOUR INFORMATION</strong></p>\r\n\r\n<p>The information you provide us isn&rsquo;t set in stone. You can update your online account information with us at any time by clicking on the &ldquo;My Account&rdquo; link found in the upper right corner of the home page.</p>\r\n\r\n<p><strong>DATA INTEGRITY AND RETENTION</strong></p>\r\n\r\n<p>We use the information that we collect about you only for the purposes for which it is collected and consistent with this policy. We keep information provided to us for as long as we believe necessary for our business purposes and as permitted by applicable law.</p>\r\n\r\n<p><strong>CHILDREN</strong></p>\r\n\r\n<p>https://www.onlineglobalshop.com&nbsp;does not sell products for purchase by children. We sell children&rsquo;s products for purchase by adults. If you are under 18, you may use dailybazar.com.bd only with the involvement of a parent or guardian. We do not knowingly collect personal information from children under the age of 13 without the consent of the child&rsquo;s parent or guardian.</p>\r\n\r\n<p>&nbsp;<strong>CHANGES TO THIS POLICY</strong></p>\r\n\r\n<p>Our business and the laws that regulate us change from time to time, and we reserve the right to change this policy. If we do change this policy, we will post the revised version on this website. If we propose to change our policy in a way that would permit us to make additional uses of the personal information that we had previously collected about you, we will obtain your affirmative, express consent before using your information in a materially different way.</p>\r\n\r\n<p>&nbsp;</p>', NULL, '2023-03-25 09:53:24'),
