(1, 'Jeff Stone', 'jeff@eurasiancapitalllc.com', '917-960-1937', 'Your Corporate Updates', 'Hi, I was looking on google for interesting businesses and I found your brand which really stood out to me. \r\n\r\nI wanted to introduce myself and see if I could be added to your corporate updates (ongoing corporate progress). \r\nI have spent 35 years both sell-side/buy-side and have managed to build a deep repository of investors domestic as well as off-shore that we convey our deal flow.\r\n\r\n\r\nWould you have any time this week to get on a zoom call and see if we have any synergies? \r\nI\'m going to leave my calendar here, I hope I\'m not being too forward. \r\n\r\n\r\nhttps://calendly.com/eurasiancapital/meeting-with-jeff\r\n\r\n-Jeff\r\n\r\nThanks, speak soon', 1, '0', '2022-09-20 08:22:58', '2023-01-24 12:41:04', NULL),
(6, 'Istiak Ahmed', 'bappi68676000@gmail.com', '01968676000', '26 tk t shirt', 'এইটা কি ক্যাশ অন ডেলিভারি', 0, '0', '2023-03-26 10:18:58', '2023-03-26 10:18:58', NULL),
