(12, 'Kendra Hart', 'kendra.hart@commercial-cleanrs.com', '6128888872', 'Cleaning near you', 'Hi! I am in Minnesota and would be happy to visit your business and submit a bid for your recurring weekly (or more) janitorial and disinfection needs.\r\n\r\nWould you like to compare pricing on your office cleaning service?\r\n\r\nI\'d be happy to provide you with a no-obligation quote on your facilities cleaning.\r\n\r\nPlease simply respond and I will send next steps.\r\n\r\nThanks,\r\nKendra\r\n\r\nKendra Hart\r\nDirector of Operations\r\nCommercial Cleanrs\r\n(612) 888-8872\r\nkendra.hart@commercial-cleanrs.com\r\n\r\nPlease respond with \"stop\" to opt out.', 0, '0', '2023-03-29 08:31:58', '2023-03-29 08:31:58', NULL),
