nty).</p>', 0, NULL, '2023-01-03 07:02:47', '2023-03-28 09:07:42', 1, 1, 'Xiaomi Redmi RMMNT215NF 21.45-inch FHD Monitor [2 Years Warranty]', 'Quick Overview\r\n\r\n    DVI Port - No\r\n    VGA Port - 1\r\n    HDMI Port - 1\r\n    Display Resolution - 1920x1080\r\n    Response Time (ms) - 6ms\r\n    Display Size (Inch) - 21.45', '2023-03-19-6416b8b67de1b.png', 1, NULL, 0.00, 0, NULL, NULL, '100654'),
