(71, 'admin', 1, 'TP-Link TL-WN823N 300 Mbps Wireless USB Adapter - Black', 'tp-link-tl-wn823n-300-mbps-wireless-usb-adapter-black-aEwLpw', '[{\"id\":\"31\",\"position\":1},{\"id\":\"50\",\"position\":2}]', 18, 'pc', 1, 1, '[\"2023-02-18-63f08b4a6246e.png\",\"2023-02-18-63f08b84dbedb.png\",\"2023-02-18-63f09fe8a9267.png\"]', '2023-02-18-63f08b4a62ef2.png', '0', NULL, 'youtube', NULL, '[]', 0, 'null', '[]', '[]', 0, 1200, 500, '0', 'percent', '200', 'flat', 9, 1, '<h2>TP-Link TL-WN823N Wireless USB Adapter &ndash; Black</h2>\r\n\r\n<p>TP-Link TL-WN823N LAN Card comes with USB 2.0 Interface, 300Mbps Data Transfer Rates, IEEE 802.11b,g,n Network Standards, Wi-Fi Protected Setup (WPS) Button. This LAN Card is also featured with Internal antenna, 2.400-2.4835GHz Frequency range, &lt;20dBm (EIRP) Transmit Power, 64/128-bit WEP WPA-PSK / WPA2-PSK WPA / WPA2 Wireless Security and certified with FCC, IC, RoHS. In this LAN Card, 300Mbps wireless speed ideal for smooth HD video, voice streaming and online gaming and the ini-sized design for convenient portability with a reliable high performance. Here, the SoftAP Mode &ndash; Turn a wired internet connection to a PC or Laptop into a Wi-Fi hotspot and you can easily setup a secure wireless connection with one-touch WPS button. The TL-WN823N comes with a fast, reliable wireless connection for lag-free online gaming and video streaming. Better still, TL-WN823N achieves the best performance with wireless N devices, but also works seamlessly with existing IEEE 802.11b/g networks. This TP-Link TL-WN823N LAN Card has 01 year warranty.</p>\r\n\r\n<p><strong>Specifications:</strong></p>\r\n\r\n<ul>\r\n	<li>Brand: TP-Link</li>\r\n	<li>Model Number: TP-Link TL-WN823N</li>\r\n	<li>Extensive Coverage</li>\r\n	<li>USB Easy Sharing</li>\r\n	<li>Easy Setup</li>\r\n	<li>Backward Compatible</li>\r\n	<li>USB modems</li>\r\n	<li>Data Rate: 300Mbps</li>\r\n	<li>Color: Black</li>\r\n	<li>Warranty: 01 Year Warranty</li>\r\n</ul>', 0, NULL, '2023-01-04 06:28:08', '2023-03-20 06:22:44', 1, 1, 'TP-Link TL-WN823N 300 Mbps Wireless USB Adapter - Black', 'Specifications:\r\nModel Number: TP-Link TL-WN823N\r\nExtensive Coverage\r\nUSB Easy Sharing\r\nEasy Setup\r\nBackward Compatible\r\nUSB modems\r\nData Rate: 300Mbps\r\nColor: Black\r\nWarranty: 1 Year', '2023-03-19-6416b8f3e9848.png', 1, NULL, 0.00, 0, NULL, NULL, '184996'),
(75, 'admin', 1, 'DAMIX M10 TWS with Digital Indicator True Wireless Earbuds', 'newest-m10-tws-with-digital-indicator-true-wireless-earbuds-ntLQKA', '[{\"id\":\"40\",\"position\":1},{\"id\":\"41\",\"position\":2}]', 23, 'pc', 1, 1, '[\"2023-02-23-63f76617c02c3.png\",\"2023-03-13-640ede55dc9e2.png\",\"2023-03-13-640ede55dcfc3.png\",\"2023-03-13-640ede55dd157.png\"]', '2023-04-01-6427f0f025ca6.png', '1', NULL, 'youtube', NULL, '[]', 0, 'null', '[]', '[]', 0, 1000, 300, '0', 'percent', '45', 'percent', 15, 1, '<h3><strong>M10 TWS Wireless Earbuds</strong></h3>\r\n\r\n<p>M10 TWS Wireless Earbuds with the 5.1 chip give you very efficient wireless performance. The 5.1 chip manages battery life very well. It adopts a Bluetooth V5.1 chip, 10m connection distance, stable performance, high transmission, low consumption, and strong compatibility. Ergonomically designed for a more comfortable fit on the auricle. The two-ear split design allows the single ear to be used separately, equivalent to two independent Bluetooth headsets. The charging compartment can be used as a mobile phone stand, portable mobile phone stand, and support horizontal and vertical placement. Watch live broadcasts and movies without the need to purchase an additional mobile phone stand.</p>\r\n\r\n<h3><strong>Specification:&nbsp;</strong></h3>\r\n\r\n<ul>\r\n	<li>Style: Ear Hook</li>\r\n	<li>Vocalism Principle: Dynamic</li>\r\n	<li>Control Button: Yes</li>\r\n	<li>Active Noise-Cancellation: Yes</li>\r\n	<li>Communication: Wireless</li>\r\n	<li>Volume Control: No</li>\r\n	<li>Sensitivity: 98dB</li>\r\n	<li>Wireless Type: Bluetooth</li>\r\n	<li>Is wireless: Yes</li>\r\n	<li>Max Output: 1mW</li>\r\n	<li>Line Length: 0m</li>\r\n	<li>Support APP: No</li>\r\n	<li>Function: Sport</li>\r\n	<li>Number Of Drivers: 2</li>\r\n	<li>Plug Type: NONE</li>\r\n	<li>Impedance Range: up to 32 Ω</li>\r\n	<li>Connectors: USB</li>\r\n	<li>Model Number: M10</li>\r\n	<li>Earcups Type: Semi-open</li>\r\n	<li>Headphone Pads Materia