(96, 'admin', 1, 'Pure Mustard Oil 5 Liter ( Cold Pressed ) খাঁটি সরিষার তেল', 'pure-mustard-oil-7pkA83', '[{\"id\":\"44\",\"position\":1},{\"id\":\"45\",\"position\":2},{\"id\":\"49\",\"position\":3}]', 26, 'pc', 1, 1, '[\"2023-03-16-6412dc4911ef2.png\",\"2023-03-25-641ea525c466f.png\"]', '2023-03-25-641e94e5d1f82.png', '1', NULL, 'youtube', NULL, '[]', 0, 'null', '[]', '[]', 0, 1400, 1000, '0', 'percent', '50', 'flat', 15, 1, '<p>খাঁটি সরিষার তেল উন্নতজাতের দেশী সরিষা বীজ থেকে প্রস্তুতকৃত।কাঠের ঘানিতে ১ম চাপে এই তেল বের করে অর্গানিক পদ্ধতিতে পরিশোধন হয়।তাই&nbsp; সরিষার তেলে পাওয়া যায় ঐতিহ্যের স্বাদ।ঠিক যেন ছোট বেলায় খাওয়া দাদী-নানীর হাতের রান্না।স্বাদে ও সুস্বাস্থ্যে&nbsp; এ যুগের সেরা সরিষার তেল।</p>\r\n\r\n<p>তাই পরিবারের সবার সুস্বাস্থ্য নিশ্চিত করতে প্রতিদিনের রান্না হোক&nbsp; ঘানি ভাঙ্গা সরিষার তেলে।</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;Description</p>\r\n\r\n<ul>\r\n	<li>ঘানি ভাংগা সরিষার তেল এ পুষ্টিমান এবং গুণাগুণ অক্ষুন্ন থাকে।</li>\r\n	<li>সরিষার তেল ত্বকের তামাটে ভাব ও দাগ দূর করে এবং ত্বককে প্রাকৃতিকভাবে উজ্জ্বল করতে পারে।</li>\r\n	<li>সরিষার তেল খুব ঘন হয় এবং এতে উচ্চমাত্রার ভিটামিন ই থাকে। এই তেল ক্ষতিকর অতিবেগুনি রশ্মি থেকে এবং অন্যান্য দূষিত পদার্থ থেকে ত্বককে সুরক্ষা করে।</li>\r\n	<li>সরিষার তেল চুলের বৃদ্ধিতে সাহায্য করে। অকালে চুল সাদা হওয়া রোধ করে ও চুল পড়া কমায়।</li>\r\n	<li>সরিষার তেল পরিপাক, রক্ত সংবহন ও রেচনতন্ত্রের শক্তিশালী উদ্দীপক হিসেবে কাজ করে।</li>\r\n	<li>সরিষা তেলের পুষ্টি উপাদান, ভিটামিন, মিনারেল চুলের অকালপক্বতা রোধ করে থাকে।</li>\r\n	<li>সরিষার তেল মনোস্যাচুরেটেড ও পলিস্যাচুরেটেড ফ্যাটে সমৃদ্ধ বলে কোলেস্টেরলের ভারসাম্য রক্ষা করতে সাহায্য করে। এর ফলে কার্ডিওভাসকুলার রোগের ঝুঁকি কমে।</li>\r\n</ul>', 0, NULL, '2023-01-18 11:02:37', '2023-03-25 07:39:17', 1, 1, 'Pure Mustard Oil 5 Liter ( Cold Pressed ) খাঁটি সরিষার তেল', '🌿কারণ আমরা বাজার থেকে কৃষকদের কাছ থেকে বাছাই কৃত দেশী সরিষার দানা ক্রয় করে নিজ তত্ত্বাবধানে নিজে উপস্হিত থেকে খাটিঁ সরিষার তেল উৎপাদন করি ও ফিল্টার করে শতভাগ মান নিশ্চিত করে বাজার জাত করছি।', '2023-03-19-6416e713d