(98, 'admin', 1, 'Pure গাওয়া  Ghee (ঘি) 500 Gram', 'pure-premium-ghee-ghi-500-gram-pQzMvm', '[{\"id\":\"44\",\"position\":1},{\"id\":\"45\",\"position\":2},{\"id\":\"47\",\"position\":3}]', 26, 'kg', 1, 1, '[\"2023-03-28-6422b2e75aba8.png\"]', '2023-03-22-641aea2a4af02.png', '1', NULL, 'youtube', NULL, '[]', 0, 'null', '[]', '[]', 0, 750, 500, '0', 'percent', '100', 'flat', 20, 1, '<h2>Description</h2>\r\n\r\n<p>* খাঁটি দুধ থেকে তৈরি করা হয়।<br />\r\n* দুধ থেকে ক্রিম সেপারেটর মেশিনের মাধ্যমে প্রথমে ননী বা ক্রিম আলাদা করা হয়। পরে তা জ্বাল দিয়ে ঘি প্রস্তুত করা হয়।<br />\r\n* দুধ সংগ্রহ থেকে শুরু করে জ্বাল দিয়ে ঘি প্রস্তুতি এবং প্যাকেজিং পুরো প্রক্রিয়া সম্পূর্ণ নিজস্ব তত্ত্বাবধানে করা হয়।<br />\r\n* ঘি গরম থাকা অবস্থায়ই প্যাক করা হয়।<br />\r\n* সঠিকভাবে সংরক্ষণ করতে পারলে প্যাকেজিং এর তারিখ হতে ৬ মাস পর্যন্ত ঘি ভালো থাকে।</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>ঘিয়ের ৫ টি বিস্ময়কর গুণঃ </strong><br />\r\n১. ত্বকের শুষ্কতা দূর করে এবং ত্বকের আর্দ্রতা ধরে রাখে।<br />\r\n২. ঘি তে রয়েছে প্রচুর ভিটামিন এ, তাই এটি চোখের জন্য ভালো। গ্লুকোমা রোগীদের জন্য অনেক উপকারী।<br />\r\n৩. নিয়মিত ঘি খেলে যে হরমোন নিঃসরণ হয়, এতে শরীরের সন্ধিগুলো ভালো থাকে।<br />\r\n৪. ঘি অ্যান্টি অক্সিডেন্ট সমৃদ্ধ খাবার তাই অন্য খাবার থেকে ভিটামিন ও খনিজ শোষণ করে শরীরের রোগ প্রতিরোধ ক্ষমতা বৃদ্ধি করে।<br />\r\n৫. পোড়া ক্ষত সারাতে কাজ পুরোনো ঘি ম্যাজিকের মত কাজ করে। আয়ুর্বেদ শাস্ত্রে মতে ঘি খেলে মস্তিষ্কের ধার বৃদ্ধিপায় ও স্মৃতিশক্তি বাড়ে।</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>কীভাবে বুঝবেন বিশুদ্ধ ঘি খাচ্ছেন কিনা?</strong><br />\r\n১। ঘি খাঁটি কিনা সেটা বোঝার সবচেয়ে সহজ উপায় হলো প্যানে গরম করা। এক চামচ ঘিদিন গরম প্যানে। যদি ঘি তাৎক্ষণিকভাবে গলে যায় এবং গাঢ় বাদামি রঙে পরিণত হয়, তবে এটি খাঁটি ঘি। যদি ঘি গলতে সময় নেয় এবং হলদে হয়ে যায়, তবে বুঝবেন ঠকেছেন আপনি।<br />\r\n২। ১ চা চামচ ঘি নিন হাতের তালুতে। ঘি যদি ত্বকের সংস্পর্শে আপনাতেই গলে যায় তবে বুঝবেন ঘি বিশুদ্ধ।</p>', 0, NULL, '2023-01-19 08:05:33', '2023-03-28 09:27:20', 1, 1, 'Pure গাওয়া  Ghee (ঘি) 500 Gram', 'ঘি তে ভিটামিন এ, ই, এবং শরীরের রোগ প্রতিরোধ শক্তিবর্ধক ফ্যাটি এসিড আছে। যে কোন রান্নায় স্বাদ ও গন্ধ বৃদ্ধি করতে এক টেবিল চামচ অর্গানিক ঘি মেশাতে পারেন।', '2023-03-28-6422b2f894363.png', 1, NULL, 0.00, 0, NULL, NULL, '115631'),
