(103, 'admin', 1, 'Mixed Flower Honey 500 gram  (মিক্স ফুলের মধু)', 'mixed-flower-honey-500-gram-Pmkupt', '[{\"id\":\"44\",\"position\":1},{\"id\":\"45\",\"position\":2},{\"id\":\"46\",\"position\":3}]', 26, 'kg', 1, 1, '[\"2023-03-28-6422b896b8837.png\",\"2023-03-28-6422b8faa735d.png\"]', '2023-03-25-641ec0ac51239.png', '1', NULL, 'youtube', NULL, '[]', 0, 'null', '[]', '[]', 0, 550, 300, '0', 'percent', '50', 'flat', 20, 1, '<p>মিক্স ফুলের মধু (Mixed Flower Honey) বৈশিষ্ট্য</p>\r\n\r\n<p>১ .গ্রামের বিভিন্ন স্থান যেমন;জঙ্গল,ঘরের কোন,বাঁশ ঝার,বাগান ইত্যাদি জায়গা এই মধুর উৎস। তবে বিশেষ ক্ষেত্রে সুন্দরবনের প্রাকৃতিক মধুকেও &nbsp; এই মধু বলা যেতে পারে ।</p>\r\n\r\n<p>২ &nbsp;মৌমাছি বিভিন্ন জায়গা থেকে এ মধু সংগ্রহ করে তাই এটি প্রধানত মিশ্র মধু।</p>\r\n\r\n<p>৩. এটি মিশ্র মধু হওয়ায় &nbsp;বৈচিত্রতা সবচেয়ে বেশী।</p>\r\n\r\n<p>&nbsp;মিশ্র ফুলের&nbsp; মধু (Mixed Flower Honey) মধু সবচেয়ে সুলভ ও সকলের কাছে গ্রহণীয় মধুর মধ্যে অন্যতম। মধু হচ্ছে মৌমাছি কর্তৃক ফুলের নেক্টার থেকে সংগৃহীত এক প্রকার সুপেয় তরল উপাদান। এর রয়েছে নানাবিধ স্বাস্থ্য উপকারিতা। মধু বিভিন্ন ধরনের হতে পারে। এর বিভিন্নতা নির্ভর করে মৌমাছি সর্বাধিক কোন ফুল থেকে নেক্টার সংগ্রহ করেছে তার উপর। মিশ্র ফুলের মধু সাধারণত বিশেষ কোন ফুল নয় বরং বিভিন্ন ফুলের নেক্টার থেকে সংগৃহীত।<br />\r\nমধুর উপকারিতা &ndash;</p>\r\n\r\n<p>১। এতে রয়েছে বেশ কিছু খনিজ উপাদান যা শারীরিক সুস্থতা প্রদানে বেশ গুরুত্বপূর্ণ ভূমিকা রাখে।<br />\r\n২। দেহে তাপ ও শক্তির যোগান দেয়।<br />\r\n৩। হজমক্রিয়াকে ত্বরান্বিত করে হজমে সহায়তা করে।<br />\r\n৪। অ্যাসিডিটি উপশমে বেশ ভালো কাজ করে।<br />\r\n৫। কোষ্ঠ্যকাঠিন্য এবং ডায়রিয়াতেও এটি বেশ উপযোগী।<br />\r\n৬। দেহের রোগ প্রতিরোধ ক্ষমতা বৃদ্ধি করে দেহকে সুরক্ষিত রাখে।<br />\r\n৭। ঘুমের সমস্যা সমাধানে এটি বেশ ভালো কাজ করে। রাতে ঘুমাতে যাওয়ার পূর্বে এক চা চামচ মধু হতে পারে অনিদ্রার ক্ষেত্রে বিশেষ কার্যকরী।<br />\r\n৮। রক্তশূন্যতা দূর করে ভূমিকা রাখে।<br />\r\n৯। দেহের পানিশূন্যতা দূর করতে ভূমিকা রাখে।<br />\r\n১০। অতিরিক্ত মেদ কমিয়ে ওজন হ্রাসে ভূমিকা রাখে।<br />\r\n১১। ত্বক মসৃণ ও সজীব রাখতে কাজ করে এটি।<br />\r\n১২। রূপচর্চায় এক বহুল ব্যবহৃত উপাদান।<br />\r\n১৩। উচ্চ রক্তচাপ নিয়ন্ত্রণে রাখতে বেশ ভালো কাজ করে।<br />\r\n১৪। হাঁপানি ও ফুসফুসের সমস্যা সমাধানে কার্যকরী।<br />\r\n১৫। সর্দি, কাশি, গলা ব্যথা দূর করতে চমৎকার কাজ করে।</p>', 0, NULL, '2023-01-21 07:44:03', '2023-03-28 09:52:58', 1, 1, 'Mixed Flower Honey 500 gram  (মিক্স ফুলের মধু)', 'মধু হচ্ছে মৌমাছি কর্তৃক ফুলের নেক্টার থেকে সংগৃহীত এক প্রকার সুপেয় তরল উপাদান।\r\nমিশ্র ফুলের মধু সাধারণত বিশেষ কোন ফুল নয় বরং বিভিন্ন ফুলের নেক্টার থেকে সংগৃহীত।', '2023-03-19-6416eb6f5534a.png', 1, NULL, 0.00, 0, NULL, NULL, '180184'),
