(119, 'admin', 1, 'Black Seed Oil (কালোজিরা তেল) - 100 gm', 'black-seed-oil-kalojira-tel-100-gm-bvU5XW', '[{\"id\":\"44\",\"position\":1},{\"id\":\"45\",\"position\":2}]', 26, 'pc', 1, 1, '[\"2023-03-20-64183f1219b3f.png\",\"2023-03-20-64183f121a82d.png\",\"2023-03-20-64183f121a987.png\",\"2023-03-20-64183f121b548.png\"]', '2023-03-20-64183f121d248.png', NULL, NULL, 'youtube', NULL, '[]', 0, '[\"11\"]', '[{\"name\":\"choice_11\",\"title\":\"Weight\",\"options\":[\"100 gm\",\"      500 gm\"]}]', '[{\"type\":\"100gm\",\"price\":240,\"sku\":null,\"qty\":1},{\"type\":\"500gm\",\"price\":940,\"sku\":null,\"qty\":1}]', 0, 240, 100, '0', 'percent', '40', 'flat', 2, 1, '<p>অনলাইন গ্লোবাল শপ নিয়ে এলো ১০০% খাঁটি কালোজিরার তেল। যাতে রয়েছে ক্যন্সার প্রতিরোধক কেরোটিন ও শক্তিশালী হর্মোন, প্রস্রাব সংক্রান্ত বিভিন্ন রোগ প্রতিরোধকারী উপাদান, পাচক এনজাইম ও অম্লনাশক উপাদান এবং অম্লরোগের প্রতিষেধক সহ ১০০টিরও বেশি উপযোগী উপাদান। মাথা ব্যাথা, বাতের ব্যাথা, সর্দি, চর্মরোগ, দাঁত ব্যথা, ব্লাড প্রেসার, অর্শ রোগ, শ্বাসকষ্ট, ডায়বেটিক, জন্ডিস ও গ্যাষ্ট্রীক নিরাময় সহ নানাবিধ ক্ষেত্রে <strong>কালোজিরা তেল</strong> ব্যবহার করতে পারবেন।</p>\r\n\r\n<p>বিঃ দ্রঃ গর্ভাবস্থায় ও দুই বছরের কম বয়সের বাচ্চাদের কালোজিরার তেল খাওয়ানো উচিত নয়। তবে বাহ্যিক ভাবে ব্যবহার করা যাবে।</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Black Seed Oil (কালোজিরার তৈল) 50ML</strong>.&nbsp;is an oil that is extracted from the seeds of black cumin, it&#39;s also known as black cumin seed oil. Black seed oil offer a number of health benefits like Reducing high blood pressure, Reducing high cholesterol, Improving rheumatoid arthritis symptoms, Decreasing asthma symptoms, Reducing stomach upset. You can also use black seed oil for beauty benefits like Acne, Hydrating hair, Psoriasis, Softening skin, Wound healing. Order now &amp; get it within 2 days&nbsp;in anywhere in Bangladesh.</p>\r\n\r\n<p><strong>কালিজিরা তেল</strong></p>\r\n\r\n<p>মহান আল্লাহ প্রকৃতিতে মানুষদের জন্য অসাধারণ নেয়ামত রেখেছেন। অতি প্রাচীনকাল&nbsp; থেকে প্রকৃতির মধ্যে থাকা বিভিন্ন উদ্ভিদ, লতা-পাতা, বীজ&nbsp; মানুষের নানা উপকারে ব্যবহার হয়ে এসেছে। কালিজিরা তেমনই একটি উপকারী বীজ। এটি রান্নায় গুরুত্বপূর্ণ মসলা&nbsp; এবং স্বাস্থ্যগত সমস্যায় মহষৌধ হিসেবে ব্যবহার হয়ে থাকে। কালিজিরাকে মৃত্যু ছাড়া সকল রোগের প্রতিষেধক বলা হয়। এই ব্যাপারে মহানবী (সাঃ) এর হাদিসও আছে। তিনি বলেছেন, &ldquo;তোমরা কালিজিরা ব্যবহার করবে, কেনোনা এতে মৃত্যু ব্যতীত সকল রোগের প্রতিষেধক রয়েছে&rdquo;-(সহিহ বুখারী)। এর মাধ্যমে কালিজিরার বিস্তর স্বাস্থ্যগুণ এবং উপকারিতা সম্পর্কে বুঝা যায়।</p>\r\n\r\n<p>কালিজিরার মধ্যে ১০০টিরও বেশি পুষ্টি উপাদান রয়েছে। এতে রয়েছে প্রায় ২১ শতাংশ আমিষ, ৩৮ শতাংশ শর্করা এবং ৩৫ শতাংশ ভেষজ তেল এবং চর্বি। এতে আরো রয়েছে লিনোলিক অ্যাসিড, অলিক অ্যাসিড, স্টিয়ারিক অ্যাসিড, প্রোটিন, নিজেলিন, পটাশিয়াম, ফসফরাস, ক্যালসিয়াম, সোডিয়াম, ম্যাগনেসিয়াম, ম্যাঙ্গানিজ, কপার, জিংক, ভিটামিন বি-১, ভিটামিন বি-২, ভিটামিন বি-৩, এবং লৌহের মতো গুরুত্বপুর্ন পুষ্টি উপাদান। প্রাত্যহিক জীবনে কালিজিরা গ্রহণের মাধ্যমে নানাবিধ জটিল রোগ থেকে মুক্তি পাওয়া যায়। মহষৌধি গুণে সমৃদ্ধ কালিজিরার বীজ, গুড়া, তেল বিভিন্ন ভাবে ব্যবহার করা যায়। অনলাইন গ্লোবাল শপ গ্রাহক চাহিদা এবং কালিজিরার গুণাগুণ বিবেচনায় রেখে আপনাদের জন্য সম্পূর্ণ স্বাস্থ্যসম্মত এবং খাঁটি কালিজিরার বীজ, গুড়া এবং তেল সরবরাহ করছে।</p>\r\n\r\n<p><strong>কালিজিরা তেল কেনো ব্যবহার করবেন?&nbsp;</strong></p>\r\n\r\n<p>* কালিজিরার তেল অবসাদ দূর করতে সাহায্য করে। এক্ষেত্রে এক চা চামচ পুদিনা পাতার রস বা কমলার রস কিংবা এক কাপ রঙ চায়ের সাথে এক চা চামচ কালিজিরা তেল মিশিয়ে দিনে তিনবার খেলে উপকার পাওয়া যায়।</p>\r\n\r\n<p>* ১/২ চা চামচ কালিজিরা তেল মাথায় লাগালে এবং এক চা চামচ কালিজিরা তেলের সাথে সমপরিমাণ মধু মিশিয়ে দিনে তিনবার করে ২/৩ সপ্তাহ খেলে মাথা ব্যথায় উপকার পাওয়া যায়।</p>\r\n\r\n<p>* সর্দির সমস্যায় এক চা চামচ কালিজিরা তেল সমপরিমাণ মধু বা এক কাপ রং চায়ের সাথে মিশিয়ে দৈনিক ৩ বার খেলে উপকার পাওয়া যায়।</p>\r\n\r\n<p>* বাতের ব্যথা দূরীকরণে আক্রান্ত স্থান ধুয়ে পরিষ্কার করে তাতে কালিজিরা তেল দিয়ে মালিশ করলে উপকার পাওয়া যায়।</p>\r\n\r\n<p>* এক চা চামচ মাখন ও সমপরিমাণ তিলের তেল, এক চামচ কালিজিরা তেলের সাথে মিশিয়ে প্রতিদিন খেলে পাইলসের সমস্যায় উপকার পাওয়া যায়।</p>\r\n\r\n<p>* অনিয়মিত মাসিকের সমস্যায় কালিজিরা তেল দৈনিক ৩ বার খেলে কার্যকর উপকার পাওয়া যায়।</p>\r\n\r\n<p>* এক চা চামচ কালিজিরা তেল সমপরিমাণ মধুর সাথে মিশিয়ে খেলে আমাশয় সমস্যায় উপকার পাওয়া যায়।</p>\r\n\r\n<p>* শীতকালে ত্বকের যত্নে কালিজিরার তেল বডি লোশন হিসেবে ব্যবহার করে কার্যকর উপকার পাওয়া যায়।</p>\r\n\r\n<p>* লিভারের সমস্যা দূরীকরণে এক গ্লাস ত্রিপলার শরবতের সাথে এক চা চামচ কালিজিরা তেল খেলে উপকার পাওয়া যায়।</p>\r\n\r\n<p>* কালিজিরা তেল খেলে এবং নিয়মিত চুলের গোড়ায় মালিশ করলে চুল পড়া রোধে উপকার পাওয়া যায়।</p>\r\n\r\n<p>* মাথায় এই তেল ব্যবহারে রাতের বেলায় শান্তিপুর্ণ ঘুম হয়।</p>', 0, NULL, '2023-03-20 11:10:10', '2023-03-25 05:56:17', 1, 1, NULL, NULL, 'def.png', 1, NULL, 0.00, 0, NULL, NULL, '182304');
